// ZERO MERIDIAN push77
const TOKEN  = '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';
const REPO   = 'winduadiprabowo-pixel/core-meridian-data';
const BRANCH = 'main';

const F0 = "";
const F1 = "";
const F2 = "";

const FILES = [
  { path: 'src/pages/Portal.tsx', content: F0 },
  { path: 'src/components/layout/ZMSidebar.tsx', content: F1 },
  { path: 'src/pages/Dashboard.tsx', content: F2 }
];

async function run() {
  console.log('\n  ZERO MERIDIAN - push77\n');
  for (let i = 0; i < FILES.length; i++) {
    const { path, content } = FILES[i];
    process.stdout.write('  [' + (i+1) + '/' + FILES.length + '] ' + path + ' ... ');
    try {
      // Get SHA
      const r1 = await fetch(
        'https://api.github.com/repos/' + REPO + '/contents/' + path + '?ref=' + BRANCH,
        { headers: { Authorization: 'token ' + TOKEN, Accept: 'application/vnd.github.v3+json' } }
      );
      let sha = null;
      if (r1.ok) {
        const j1 = await r1.json();
        sha = j1.sha;
      }

      // Push file
      const body = { message: 'push77: ' + path, content: content, branch: BRANCH };
      if (sha) body.sha = sha;
      const r2 = await fetch(
        'https://api.github.com/repos/' + REPO + '/contents/' + path,
        {
          method: 'PUT',
          headers: { Authorization: 'token ' + TOKEN, 'Content-Type': 'application/json', Accept: 'application/vnd.github.v3+json' },
          body: JSON.stringify(body)
        }
      );
      if (r2.status === 200 || r2.status === 201) {
        console.log('OK');
      } else {
        const txt = await r2.text();
        let msg = r2.status;
        try { msg = r2.status + ' ' + JSON.parse(txt).message; } catch {}
        console.log('GAGAL: ' + msg);
      }
    } catch (e) {
      console.log('ERROR: ' + e.message);
    }
  }
  console.log('\n  Done! Cek: https://meridian-zero-jet.vercel.app\n');
}

run();
